import React, { useEffect } from 'react'
import './aboutUs.css'
import AOS from 'aos';
import 'aos/dist/aos.css';
import building from "../Image/building.jpg";

function ContactUs() {
    useEffect(() => {
        AOS.init();
    }, []);
    return (

        <div class="containter-fluid main_header">
            <div class="row ">
                <div class="col-md-10 col-12 mx-auto">
                    <div class="row">
                        <div class="col-md-6 col-12 main_header_left">
                            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Eligendi nisi voluptatem, architecto officiis vel hic minus, qui delectus aspernatur assumenda accusamus provident at neque corporis ipsam nihil deleniti! Sed, dolor.</p>
                        </div>
                        <div class="col-md-6 col-12 main_header_right">
                            <img src={building} alt='' className='building' />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ContactUs
